import Link from 'next/link';

let location = window.location.pathname;

let NavigationLink = (props) => {
	let navLinks;

	if (props.type){

		navLinks = props.linkList.map((lk, index) => (
			<li key={index} className={location == lk.link ? "is-active" : null}>
				<Link href={lk.link}>
					<a className={props.classList || ""}> {lk.name} </a>
				</Link>
			</li>
		));

		return <ul> {navLinks} </ul>;
	}

	navLinks = props.linkList.map((lk, index) => (
			<Link href={lk.link} key={index}>
				<a className={props.classList || ""}> {lk.name} </a>
			</Link>
		))

	return (
		navLinks
	);
}

export default NavigationLink;
